JdwwtI87J1GZATaUvUhxfTuDcgEGUFL5MTSnHAUiXJzF4eY42ARUvGrkfUs1vNQgUPAv9R8jCHt+XEbSZQAAAABJRU5ErkJggg==", "data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAABwAAAAcCAAAAABXZoBIAAAB+0lEQVR4nGNgIBcwIpjsPzZ9EbmV7nHwL0yEBc6o/PPbij9u+T9pves/0EzgFPt18vqKH39vrfj/jTcTKsgEM2D+BfbDLk8/HGKsm33sJyuyscxcmz4fuf9Z3HiJqsqRn0ydb7b8Q+h8eufDw3uvXC9+ZP90UfLRmR9r7iOMZXbb85Hvk9VX3uU/zr/hYxZ//c6ZCS7JWKnBd+Vb8v+r3Pn/H7Bwrpq7+STC2BS3V/JWPziVb1j9enQv9bdUtKcAwkFTGY7ys7AUPtG1YZJ90PL59a3nDj/ZYSHElcP164bKARHGwK1/v3xSFhCwErBihRkb5vLhidUbsV8fdrA/e6ug9+v7x38scDvnPrIS+MD159O/x38YOBi4er5/4PkOlzwcfMaBgYtNnFX6gbo4yx8hFX4lXriDHNjnneBiZGVnFBXiZ2Dj2azOkfgXKVaC7Y6c+PxVkuHv67//Ob2ZPFy3/YHH5679X17L3BXaY3PP+4jvK63Ha0//QYpspsofV76zCkuy7ZeQ+ezDmvQJOcrOq3Gxc3wRtP1v/1eU6eTfcyjxaf6HXZFF+Mtx+dccDHJGyuookj8irYV1pViUPn1TZq3k4/mLIskg9Eld3kb4B5M8M98XTy20NMTA9JfZbqLAwWnsDL/Y0eUYGBgYdH79f/+FnRmbFKkAAIeqwea/lCrnAAAAAElFTkSuQmCC"]}];

        var xData = rawData.map(d => d.fraction);
        var yValues = rawData.map(d => d.score);

        // Функция стилей (Обычные точки - маленькие и сплошные, Выделенные - большие и оранжевые)
        function getSeriesData(pinnedMap) {
            return yValues.map((val, idx) => {
                var isPinned = pinnedMap[idx];
                if (isPinned) {
                    return {
                        value: val,
                        symbol: 'circle',
                        symbolSize: 18,
                        itemStyle: {
                            color: '#ff8800',
                            borderColor: '#fff',
                            borderWidth: 3,
                            shadowBlur: 10,
                            shadowColor: 'rgba(255, 136, 0, 0.5)'
                        }
                    };
                } else {
                    return {
                        value: val,
                        symbol: 'circle',
                        symbolSize: 6,  // Маленькие точки
                        itemStyle: {
                            color: '#3390ec', // Сплошной цвет без белой середины
                            borderColor: '#3390ec',
                            borderWidth: 0
                        }
                    };
                }
            });
        }

        var option = {
            title: { text: 'Active Learning: Brain-Tumour-MRI', left: 'center', top: 15, textStyle: { fontSize: 20, color: '#222' } },
            grid: { left: 60, right: 40, bottom: 90, top: 70, containLabel: true },
            tooltip: { show: false },

            dataZoom: [
                { type: 'slider', show: true, xAxisIndex: [0], bottom: 30, height: 25 },
                { type: 'inside', xAxisIndex: [0] }
            ],

            xAxis: {
                type: 'category',
                name: 'Labeled Data (%)',
                nameLocation: 'middle',
                nameGap: 40,
                data: xData,
                boundaryGap: false,
                axisLine: { lineStyle: { color: '#ccc' } },
                axisLabel: { color: '#666' }
            },
            yAxis: {
                type: 'value',
                name: 'F1 Score',
                nameLocation: 'middle',
                nameGap: 50,
                scale: true,
                splitLine: { lineStyle: { type: 'dashed', color: '#eee' } }
            },
            series: [{
                type: 'line',
                data: getSeriesData({}),
                smooth: true,
                showAllSymbol: true,
                lineStyle: { width: 3, color: '#3390ec' },
                areaStyle: {
                    color: new echarts.graphic.LinearGradient(0, 0, 0, 1, [
                        { offset: 0, color: 'rgba(51, 144, 236, 0.25)' },
                        { offset: 1, color: 'rgba(51, 144, 236, 0.0)' }
                    ])
                },
                animationDurationUpdate: 100
            }]
        };

        myChart.setOption(option);

        // --- Логика Тултипов ---
        var tooltipsLayer = document.getElementById('tooltips-layer');
        var pinnedState = {};

        function updateChartStyle() {
            myChart.setOption({ series: [{ data: getSeriesData(pinnedState) }] });
        }

        myChart.on('click', function(params) {
            if (params.componentType !== 'series') return;

            var idx = params.dataIndex;
            var tipId = 'tooltip_' + idx;

            // Закрытие если открыто
            if (pinnedState[idx]) {
                var existing = document.getElementById(tipId);
                if (existing) existing.remove();
                delete pinnedState[idx];
                updateChartStyle();
                return;
            }

            var item = rawData[idx];
            var point = myChart.convertToPixel('grid', [xData[idx], yValues[idx]]);
            var px = point[0];
            var py = point[1];
            var chartW = myChart.getWidth();

            // Изображения
            var imgHtml = '';
            if (item.images && item.images.length > 0) {
                imgHtml = '<div class="img-grid">';
                item.images.forEach(src => {
                    imgHtml += '<img src="' + src + '">';
                });
                imgHtml += '</div>';
            } else {
                imgHtml = '<div style="text-align:center;color:#999;margin-top:10px;">No images</div>';
            }

            var tip = document.createElement('div');
            tip.id = tipId;
            tip.className = 'custom-tooltip';
            tip.innerHTML = `
                <div class="tip-header">
                    <span>Step ${idx}</span>
                    <span class="close-btn">&times;</span>
                </div>
                <div class="tip-body">
                    <div class="row"><span>F1 Score:</span> <b>${item.score}</b></div>
                    <div class="row"><span>Data:</span> <b>${item.fraction}% (${item.count})</b></div>
                    ${imgHtml}
                </div>
            `;

            tooltipsLayer.appendChild(tip);

            // Позиционирование (Центрирование)
            var tipW = 282;
            var tipH = tip.offsetHeight;
            var left = px - (tipW / 2);

            // Границы
            if (left < 10) left = 10;
            if (left + tipW > chartW) left = chartW - tipW - 10;

            tip.style.left = left + 'px';

            // Верх/Низ
            if (py > 400) { // Если точка ниже середины (условно)
                tip.style.top = (py - tipH - 20) + 'px';
            } else {
                tip.style.top = (py + 20) + 'px';
            }

            // Закрытие
            tip.querySelector('.close-btn').onclick = function() {
                tip.remove();
                delete pinnedState[idx];
                updateChartStyle();
            };

            // Drag & Drop
            var header = tip.querySelector('.tip-header');
            header.onmousedown = function(e) {
                e.preventDefault();
                var shiftX = e.clientX - tip.getBoundingClientRect().left;
                var shiftY = e.clientY - tip.getBoundingClientRect().top;
                var containerRect = tooltipsLayer.getBoundingClientRect();

                function moveAt(pageX, pageY) {
                    tip.style.left = (pageX - shiftX - containerRect.left) + 'px';
                    tip.style.top = (pageY - shiftY - containerRect.top) + 'px';
                }

                function onMouseMove(e) { moveAt(e.pageX, e.pageY); }
                document.addEventListener('mousemove', onMouseMove);
                document.onmouseup = function() {
                    document.removeEventListener('mousemove', onMouseMove);
                    document.onmouseup = null;
                };
            };
            header.ondragstart = function() { return false; };

            pinnedState[idx] = true;
            updateChartStyle();
        });

        window.addEventListener('resize', function() { myChart.resize(); });
    })();
    </script>
</body>
</html>
